const initialState ={    //estado global al inicio de mi aplicacion 
    dogs: [
        {
            "id": "d24defa2-b696-4302-979f-ef3c5b722971",
            "name": "pablo",
            "height": "3",
            "weight": "12",
            "life_span": "11",
            "image": "undefirned",
            "creado": "2023-04-15T17:06:34.215Z"
        }
    ]
}; 


const rootReducer=(state = initialState,  action)=>{ //es una funcion que es quien sabe que va a modificar 
  switch (action.type) {

    default:
        return {...state}
  }
}

export default rootReducer;
